"use strict";
var import_cloudflare_pages = require("./cloudflare-pages.js");
describe("getEnv()", () => {
  let envFunc;
  beforeEach(() => {
    envFunc = (0, import_cloudflare_pages.getEnv)({
      bindings: {
        TOKEN: "MY TOKEN"
      }
    });
  });
  afterEach(() => {
    (0, import_cloudflare_pages.disposeMf)();
  });
  it("Should return the value for bindings", async () => {
    const env = await envFunc();
    expect(env["TOKEN"]).toBe("MY TOKEN");
  });
  it("Should contains ASSETS", async () => {
    const env = await envFunc();
    expect(env["ASSETS"].fetch).toBeDefined();
  });
});
